import { Card, Image, List } from "semantic-ui-react";
import axios from 'axios';

export const ViewItemAnalysis = ({ item_name }) => {
  const [priceHistory, setPriceHistory] = useState([]);

  useEffect(() => {
    axios
    .get("/view_item_analysis", {
      params: {
        item_name,
      },
    })
    .then(({ data }) => {
      setPriceHistory(data.price_history);
      console.log(data)
    })
  }, []);

  return (
    <List>
      {priceHistory.map(priceHistoryPoint => {
        return (
          "Hey"
        );
      })}
    </List>
  );
};

export default ViewItemAnalysis;


